INSERT INTO `news` (`id`, `title`, `slug`, `text`) VALUES
(4, '<B>Mode d&#039;emploi</B>', '', 'Pour vous connecter, votre login et votre mot de passe sont votre mail. Le mot de passe est bien sur modifiable, tout comme les infos concernant vos enfants.<br>\r\nVous pouvez modifier vos inscriptions jusqu''&agrave la date limite annonc&eacute;e chaque mois. Au del&agrave;, seul l''administrateur du site peut entrer les changements informatiquement.<br>\r\nPour tout probl&egrave;me n&#039;h&eacute;sitez pas : <b>support@loupiots-lavallois.org</b>'),
(23, '<font color="red"><B>Inscription : du changement !</B></font>', 'date-limite-d-inscription', 'Les inscriptions sont d&eacute;sormais possible &agrave; la semaine sur notre site.<BR>\r\n<B>Le mercredi 23h59, le site se cloture automatiquement pour la semaine suivante.</B> <BR>\r\nExemple : <BR>\r\n- Le mercredi 24 fevrier 23h59, fermeture jusqu''au 4 mars inclus.<BR>\r\nNous vous invitons &agrave; entrer vos cr&eacute;neaux au plus vite afin que nous puissions &eacute;valuer au plus juste notre besoin en personnel.\r\n<BR>\r\n<B>Pour le paiement, pas de changement :</B><BR> vous payez en d&eacute;but de mois vos r&eacute;servations estim&eacute;es et vos modifications s''ajouteront ou se d&eacute;duiront sur le mois suivant.<BR>\r\n'),
(9, '<B>R&eacute;glements</B>', 'r&eacute;glements', 'Les rajouts et d&eacute;passements de temps de garderie du mois en cours seront inscrits chaque fin de semaine sur le planning internet (cases rouges).<BR>\r\nLe r&eacute;glement des d&eacute;passements devra etre group&eacute; avec celui du mois suivant ; le tableau des sommes &agrave; payer faisant apparaitre les deux informations et le total.<BR>\r\nPour nous permettre de mettre  jour les d&eacute;passements et &eacute;viter de multiplier les ch&egrave;ques, il est possible de faire le ch&egrave;que vers le 5 du mois suivant.<br>\r\n<B>Rappel :</B> vous pouvez payer en ch&egrave;que, esp&egrave;ces ou directement par virement bancaire sur notre site.<BR>\r\n<B>N&#039;oubliez-pas de d&eacute;clarer le paiement sur le site !</B><BR>'),
(15, '<B>Documents &agrave; fournir</B>', '', '<B>Liste des documents &agrave; fournir chaque ann&eacute;e:<br></B>\r\n- attestation d''assurance ;<br>\r\n- <a href=''http://laurent.damon.free.fr/loupiots/2014-Autorisation_de_sortie.pdf''>autorisation de sortie ;</a><br>\r\n- <a href=''http://laurent.damon.free.fr/loupiots/ficheliaison.pdf''>fiche de liaison</a><br>\r\nCes documents sont essentiels pour le suivi de vos enfants.<br>\r\nVeuillez prendre &eacute;galement connaissance de notre <B><a href=''http://laurent.damon.free.fr/loupiots/Reglement_loupiots_lavallois_juillet_2014.pdf''>r&eacute;glement int&eacute;rieur</a></B>.');
